import React, { Component } from "react";
import * as Bootstrap from "react-bootstrap";
import { Button } from "@material-ui/core";
import '../App.css';
export default class Buttons extends Component {
  render() {
    return (
      <div>
      <div id="Submit">
      <Bootstrap.Button variant="outline-dark" type="submit">
        Login
      </Bootstrap.Button>
    </div>
    <div id="Register">
    Click to Register     
    <Bootstrap.Button variant="outline-primary" type="submit">
    Login
  </Bootstrap.Button>
  </div>
      </div>
    );
  }
}
